import React from 'react';

import video from "../../"


const Background = () => {
    return (
        <div className='bgContainer'>
            <div className='overlay'>
                <video src={video} autoPlay loop muted />
                <div className='container'></div>
            </div>

        </div>
    );
};

export default Background;
